import DCaseMonitor as dcaseCom
import time

dcaseID = “ARXk_1Jt5eZxrWWJaIIXErjxDuc8OWZ1dFoZheepqn8_”
monitorKey = “Key_zcs8j5yu”

data = [
	{
		“Key”: “Title1",
		“Value”: 1,
	},
	{
		“Key”: “Title2”,
		“Value”: 2.0,
	},
	{
		“Key”: “Title3",
		“Value”: “3(san)“,
	},
	{
		“Key”: “Title4",
		“Value”: “red alert”,
        “Color”: “#FF0000",
	},
]

data1 = [{“Key” : “Status”,“Value” : “Works Fine”}]

dcase = dcaseCom.DCaseMonitor( dcaseID, monitorKey, sslIgnore=True )

num = 20
for i in range(num):
	# data1[0][“Value”] = str(i*5 - 0.02)+“%”
	data1[0][“Color”] = “#{:02x}{:02x}{:02x}“.format(255, 0, int(i*2.0/num * 255) )
	print(“upload data”, data1[0])
	ret = dcase.uploadData( data1 )
	print(“return”, ret)
	time.sleep(10)
